elements: "budget_regnskab:\n  '#type': webform_wizard_page\n  '#title': 'Budget & Regnskab'\n  '#prev_button_label': Forrige\n  '#next_button_label': Send\n  flexbox_bogr:\n    '#type': webform_flexbox\n    ean_nummer:\n      '#type': textfield\n      '#title': EAN-nummer\n      '#help_title': 'European Article Numbering'\n      '#help': 'Et EAN-nummer er et 13-cifret identifikations nummer, som alle offentlige myndigheder og institutioner skal have, men som ogs&aring; kan anvendes af private virksomheder.&nbsp;'\n    p_nummer:\n      '#type': textfield\n      '#title': P-nummer\n      '#description': 'Et p-nummer er et ti-cifret nummer, der entydigt repr&aelig;senterer p-enheden. Et p-nummer er altid knyttet til et CVR-nummer.'\n      '#help_title': P-nummer\n      '#help': 'Et p-nummer er et ti-cifret nummer, der entydigt repr&aelig;senterer p-enheden.&nbsp;Hvis den juridiske enhed har aktiviteter p&aring; flere adresser, skal den have underliggende produktionsenheder med hvert sit p-nummer.'\n      '#more_title': Virk.dk\n      '#more': '<a href=\"https://virk.dk\">Virk.dk</a>'\n  upload_af_filer_bogr:\n    '#type': webform_flexbox\n    los_oprettelse_aendring:\n      '#type': managed_file\n      '#title': 'LOS oprettelse/ændring'\n      '#description': 'Upload LOSID'\n      '#file_placeholder': 'Upload fil med LOS-oplysninger'\n    kontoplan:\n      '#type': managed_file\n      '#title': 'Kontoplan - Stamdata'\n      '#description': 'Upload kontoplan'\n      '#file_placeholder': 'Upload fil med stamdataoplysninger'\n  yderligere_information_br:\n    '#type': textarea\n    '#title': 'Yderligere information'\nactions:\n  '#type': webform_actions\n  '#title': 'Send knap(per)'\n  '#submit__label': Næste"
